{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/doanhuynhquang/bellabeat-case-study?scriptVersionId=107173647\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"421f1e3c","metadata":{"papermill":{"duration":0.008847,"end_time":"2022-10-04T11:35:11.159823","exception":false,"start_time":"2022-10-04T11:35:11.150976","status":"completed"},"tags":[]},"source":["# R Capstone Bellabeat Case Study\n","\n","## 1.Summary:\n","\n","Bellabeat is a high-tech company that manufactures health-focused smart products.They offer different smart devices that collect data on activity, sleep, stress, and reproductive health to empower women with knowledge about their own health and habits.\n","\n","The main focus of this case is to analyze smart devices fitness data and determine how it could help unlock new growth opportunities for Bellabeat. We will focus on one of Bellabeat's products: Bellabeat app.\n","\n","The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. The Bellabeat app connects to their line of smart wellness products.\n","\n","## 2.Business task:\n","\n","Identify trends in how consumers use non-Bellabeat smart devices to apply insights into Bellabeat's marketing strategy.\n","\n","Stakeholders: \n","* Urška Sršen - Bellabeat cofounder and Chief Creative Officer. \n","* Sando Mur - Bellabeat cofounder and key member of Bellabeat executive team. \n","* Bellabeat Marketing Analytics team.\n","\n","## 3.Prepare phase:\n","\n","#### 3.1 Data source:\n","\n","The data source used for the case study is FitBit Fitness Tracker Data. This dataset is stored in Kaggle and was made available through Mobius.\n","\n","#### 3.2 Data organized and verification:\n","\n","There are 18 csv documents and I have some identification and count the samples size (ID) for each table. I relized the due to limitation of size (30 users) and not having demographic information we could encounter a sampling bias. We are not sure if the sample is representative of the population as a whole."]},{"cell_type":"markdown","id":"4641f35d","metadata":{"papermill":{"duration":0.007442,"end_time":"2022-10-04T11:35:11.174595","exception":false,"start_time":"2022-10-04T11:35:11.167153","status":"completed"},"tags":[]},"source":["| Table Name                     | Type                | Description  \n","|--------------------------------|---------------------|------------------------------------------------------------------------------------------------------------------------------------------------------------------|\n","| dailyActivity_merged           | Microsoft Excel CSV | Daily Activity over 31 days of 33 users. Tracking daily: Steps, Distance, Intensities, Calories                                                                   |\n","| dailyCalories_merged           | Microsoft Excel CSV | Daily Calories over 31 days of 33 users                                                                                                                           |\n","| dailyIntensities_merged        | Microsoft Excel CSV | Daily Intensity over 31 days of 33 users. Measured in Minutes and Distance, dividing groups in 4 categories: Sedentary, Lightly Active, Fairly Active,Very Active |\n","| dailySteps_merged              | Microsoft Excel CSV | Daily Steps over 31 days of 33 users                                                                                                                              |\n","| heartrate_seconds_merged       | Microsoft Excel CSV | Exact day and time heartrate logs for just 7 users                                                                                                                |\n","| hourlyCalories_merged          | Microsoft Excel CSV | Hourly Calories burned over 31 days of 33 users                                                                                                                   |\n","| hourlyIntensities_merged       | Microsoft Excel CSV | Hourly total and average intensity over 31 days of 33 users                                                                                                       |\n","| hourlySteps_merged             | Microsoft Excel CSV | Hourly Steps over 31 days of 33 users                                                                                                                             |\n","| minuteCaloriesNarrow_merged    | Microsoft Excel CSV | Calories burned every minute over 31 days of 33 users (Every minute in single row)                                                                                |\n","| minuteCaloriesWide_merged      | Microsoft Excel CSV | Calories burned every minute over 31 days of 33 users (Every minute in single column)                                                                             |\n","| minuteIntensitiesNarrow_merged | Microsoft Excel CSV | Intensity counted by minute over 31 days of 33 users (Every minute in single row)                                                                                 |\n","| minuteIntensitiesWide_merged   | Microsoft Excel CSV | Intensity counted by minute over 31 days of 33 users (Every minute in single column)                                                                              |\n","| minuteMETsNarrow_merged        | Microsoft Excel CSV | Ratio of the energy you are using in a physical activity compared to the energy you would use at rest. Counted in minutes                                         |\n","| minuteSleep_merged             | Microsoft Excel CSV | Log Sleep by Minute for 24 users over 31 days. Value column not specified                                                                                         |\n","| minuteStepsNarrow_merged       | Microsoft Excel CSV | Steps tracked every minute over 31 days of 33 users (Every minute in single row)                                                                                  |\n","| minuteStepsWide_merged         | Microsoft Excel CSV | Steps tracked every minute over 31 days of 33 users (Every minute in single column)                                                                               |\n","| sleepDay_merged                | Microsoft Excel CSV | Daily sleep logs, tracked by: Total count of sleeps a day, Total minutes, Total Time in Bed                                                                       |\n","| weightLogInfo_merged           | Microsoft Excel CSV | Weight track by day in Kg and Pounds over 30 days. Calculation of BMI.5 users report weight manually 3 users not.In total there are 8 users                       |"]},{"cell_type":"markdown","id":"d45f6d14","metadata":{"papermill":{"duration":0.007238,"end_time":"2022-10-04T11:35:11.188979","exception":false,"start_time":"2022-10-04T11:35:11.181741","status":"completed"},"tags":[]},"source":["#### 3.3 Choose the dataset for analytic process:\n","\n","Knowing the datasets we have, we will upload the datasets that will help us answer our business task. On our analysis we will focus on the following datasets: \n","* Daily_activity \n","* Daily_sleep \n","* Hourly_Intensitive \n","* Hourly_Calories\n","\n","## 4. Process phase:\n","\n","#### 4.1 Install opening libraries and dataset:\n","\n","Packages:"]},{"cell_type":"code","execution_count":1,"id":"e53b439a","metadata":{"_cell_guid":"09ff12cc-e517-451c-bb8d-876a3b82e402","_uuid":"122586f0-babf-42a6-8dbd-df7e1f3516a1","collapsed":false,"execution":{"iopub.execute_input":"2022-10-04T11:35:11.207009Z","iopub.status.busy":"2022-10-04T11:35:11.205001Z","iopub.status.idle":"2022-10-04T11:35:12.858351Z","shell.execute_reply":"2022-10-04T11:35:12.856682Z"},"jupy